/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `queue_log_AFTER_INSERT` AFTER INSERT ON `queue_log` FOR EACH ROW BEGIN   
    SET @agt_id = (SELECT SUBSTRING_INDEX(NEW.agent, '|', 1));  
    SET @agt_channel = (SELECT SUBSTRING_INDEX(NEW.agent, '|', -1)); 
	IF NEW.event = 'ADDMEMBER' THEN
        UPDATE `asterisk`.`sys_agent_queues` SET status=1, dt_login=NOW(), channel=@agt_channel WHERE agentid=@agt_id AND queue=NEW.queuename;        
	ELSEIF NEW.event = 'REMOVEMEMBER' THEN
        UPDATE `asterisk`.`sys_agent_queues` SET status=0, dt_logout=NOW(), channel=NULL WHERE agentid=@agt_id AND queue=NEW.queuename;
	ELSEIF NEW.event = 'PAUSE' THEN
		UPDATE `asterisk`.`sys_agent_queues` SET status=2, dt_pause=NOW() WHERE agentid=@agt_id AND queue=NEW.queuename;
	ELSEIF NEW.event = 'UNPAUSE' THEN
		UPDATE `asterisk`.`sys_agent_queues` SET status=1, dt_unpause=NOW() WHERE agentid=@agt_id AND queue=NEW.queuename;       
	END IF;    
END */;;
DELIMITER ;
